def hesapla_istatistikler(değerler):
    if not değerler:
        return 0, 0, 0
    ortalama = sum(değerler) / len(değerler)
    sıralı_değerler = sorted(değerler)
    n = len(sıralı_değerler)
    medyan = (sıralı_değerler[n//2 - 1] + sıralı_değerler[n//2]) / 2 if n % 2 == 0 else sıralı_değerler[n//2]
    
    frekans = {}
    for değer in değerler:
        frekans[değer] = frekans.get(değer, 0) + 1
    mod = max(frekans, key=frekans.get) if frekans else 0

    return ortalama, medyan, mod



